import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Define the XSS payload
    const xssPayload = "<script>alert('XSS Attempted')</script>";

    // Locate the search input and fill it with the XSS payload
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.locator('#searchInput').fill(xssPayload);

    // Take a screenshot after entering the payload
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_payload_entered.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_payload_entered.png'));

    // Locate and click the search button
    await page.waitForSelector('.search-btn', { timeout: 5000 });
    await page.locator('.search-btn').first().click();

    // Take a final screenshot after clicking search
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_after_search.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_after_search.png'));

    // Extract the value from the input to confirm it was set
    const searchInputValue = await page.locator('#searchInput').inputValue();

    return {
      success: true,
      action: "Attempted to inject an XSS payload into the search input field.",
      extractedData: {
        searchInputValue: searchInputValue
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to attempt XSS via search input.",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
